import React, { useState } from 'react';
import { render } from 'react-dom';
import './style.css';
import { Simples, Composto, Main } from './convJuros.js';
import { CompoundInterest } from './jurosComp.js';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/';
import Table from 'react-bootstrap/Table'

export function Component0() {
  return (
    <p>
      <Table striped bordered hover>
  <thead>
    <tr>
      <th>#</th>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Username</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>1</td>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <td>2</td>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <td>3</td>
      <td colSpan="2">Larry the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</Table>
    </p>
  );
}

export function Component1() {
  return (
    <div>
      <Main/>
    </div>
  );
}

export function Component2() {
  return (
    <div>
      <CompoundInterest/>
    </div>
  );
}

export default function Home() {
  const [comp2Render, setComp2Render] = useState(0);

  return (
    <div>
      <header>
        <div class="container" />
        <div id="logo">
          <img src="logo.png" alt="texto" height="400" width="400" />
        </div>
      </header>
      <div class="containerCentro1">
        <div class="containerCentro2">
          <div id="menu">

            <div className="App">
              <button onClick={() => setComp2Render(1)}>Interest Converter</button>
              <button onClick={() => setComp2Render(2)}>Compound Interest Converter</button>
            </div>

          </div>
        </div>
      </div>
      <div id="principal">

        <div class="efeito">

          <div class="container">

            <div>
              {comp2Render === 1 && (
                <Component1 />
              )}
              {comp2Render === 2 && (
                <Component2 />
              )}
              {comp2Render === 0 && (
                <Component0 />
              )}
            </div>

          </div>
        </div>
      </div>
      <footer>Developed by Lucas Marinho</footer>
    </div>
  )
}



